import React from 'react';
import Card from './Card';



const CardList = ({foodP}) =>{
    return(
        foodP.map(food => {
            if(true){
                throw new Error('throw Error test')
            }
            return (                        //這邊的return本來用<div>包住Card，結果一直出現需要key
                <Card 
                key={food.ndb_no}
                shrt_desc={food.shrt_desc} 
                energ_kcal={food.energ_kcal}
                />
            )
        })

    )
}


